import React from 'react';

const Map = () => {

    const MyList = ['sobuj', 'fahad', 'mahamud', 'hay', 'mehedi', 'rakib'];
    const ListItems = MyList.map((NewList) => {
        return <li> {NewList} </li>
    })

    return (
        <div className="mt-5 text-center">
            <h1 className="ProColor"> map এর কাজ </h1>
            <ol>
                {ListItems}
            </ol>        
        </div>
    );
};

export default Map;
